  `booking_type` char(1) DEFAULT NULL COMMENT 'Now->1,Scheduled->2',
  `total_miles` float DEFAULT '0',
  `invoice_number` varchar(200) DEFAULT NULL,
  `invoice_date` timestamp NULL DEFAULT NULL,
