  `notes` varchar(300) DEFAULT '0',
  `journey_start_km` varchar(100) DEFAULT '0',
  `journey_end_km` varchar(100) DEFAULT '0',
  `pickup_lat` double DEFAULT NULL,
  `pickup_long` double DEFAULT NULL,
  `drop_lat` double DEFAULT NULL,
  `drop_long` double DEFAULT NULL,
  `status` char(1) DEFAULT '0' COMMENT '0=>''pending'',''1=>''booked'',''2''=>''cancelled'',''3''=>''paid'' ',
  `price` float(6,2) DEFAULT '0.00' COMMENT 'price',
  `pida_fee` float(6,2) DEFAULT '0.00' COMMENT 'pida fee',
  `dimension` float(6,2) DEFAULT '0.00' COMMENT 'dimension',
  `cubicfeet` float(6,2) DEFAULT '0.00' COMMENT 'cubicfeet',
  `run_cron_job_assign` enum('Y','N') DEFAULT 'N' COMMENT 'Run cron job before 2 hours of booking starts',
  `created` int(11) DEFAULT NULL,
  `modified` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;
